contracts/Cars.sol.content:
// SPDX-License-Identifier:GPL-3.0

pragma solidity ^0.8.0;

import { ISuperHonk } from "./ISuperHonk.sol";

contract Cars {

    enum CarStatus { driving, parked }

    event CarHonk(uint256 indexed carId);

    struct Car {
        bytes3 colour;
        uint8 doors;
        CarStatus status;
        address owner;
    }

    ISuperHonk private superHonk;
    uint256 public numCars = 0;
    mapping(uint256 => Car) public cars;

    constructor(
        address superHonkAddress
    ) {
        superHonk = ISuperHonk(superHonkAddress);
    }

    function addCar(
        bytes3 colour,
        uint8 doors
    )
        public
        payable
        returns(uint256 carId)
    {
        require(
            msg.value > 0.1 ether,
            "requires payment"
        );
        carId = ++numCars;
        Car memory newCar = Car(
            colour,
            doors,
            CarStatus.parked,
            msg.sender
        );
        cars[carId] = newCar;
    }

    function statusChange(
        uint256 carId,
        CarStatus newStatus
    )
        public
        onlyOwner(carId)
    {
        require(
            cars[carId].status != newStatus,
            "no change"
        );
        cars[carId].status = newStatus;
    }

    function honk(
        uint256 carId,
        bool isLoud
    )
        public
        onlyOwner(carId)
    {
        emit CarHonk(carId);
        if (isLoud) {
            superHonk.honk();
        }
    }

    modifier onlyOwner(
        uint256 carId
    )
    {
        require(
            cars[carId].owner == msg.sender,
            "only owner"
        );
        _;
    }

}

contracts/ISuperHonk.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

interface ISuperHonk {
  function count() external view returns (uint256);

  function honk() external;
}

contract SuperHonk is ISuperHonk {
    uint256 public count;

    event LoudSound(address indexed source);

    function honk()
      public
    {
        count += 1;
        emit LoudSound(msg.sender);
    }
}

